// SPDX-License-Identifier: MIT
pragma solidity >=0.4.24;

//Importing openzeppelin-solidity ERC-721 implemented Standard
import "../app/node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../app/node_modules/@openzeppelin/contracts/utils/Address.sol";

// StarNotary Contract declaration inheritance the ERC721 openzeppelin implementation
contract StarNotary is ERC721 {

    // Star data
    struct Star {
        string name;
    }

    // Implement Task 1 Add a name and symbol properties
    // name: Is a short name to your token
    // symbol: Is a short string like 'USD' -> 'American Dollar'
    constructor() ERC721("Star Notary Token", "SNT") {}


    // mapping the Star with the Owner Address
    mapping(uint256 => Star) public tokenIdToStarInfo;
    // mapping the TokenId and price
    mapping(uint256 => uint256) public starsForSale;


    // Create Star using the Struct
    function createStar(string memory _name, uint256 _tokenId) public { // Passing the name and tokenId as a parameters
        Star memory newStar = Star(_name); // Star is an struct so we are creating a new Star
        tokenIdToStarInfo[_tokenId] = newStar; // Creating in memory the Star -> tokenId mapping
        _mint(msg.sender, _tokenId); // _mint assign the the star with _tokenId to the sender address (ownership)
    }

    // Putting an Star for sale (Adding the star tokenid into the mapping starsForSale, first verify that the sender is the owner)
    function putStarUpForSale(uint256 _tokenId, uint256 _price) public {
        require(ownerOf(_tokenId) == msg.sender, "You can't sale the Star you don't owned");
        starsForSale[_tokenId] = _price;
    }


    // Function that allows you to convert an address into a payable address
    function _make_payable(address x) internal pure returns (address payable) {
        return payable(address(uint160(x)));
    }

    function buyStar(uint256 _tokenId) public  payable {
        require(starsForSale[_tokenId] > 0, "The Star should be up for sale");
        uint256 starCost = starsForSale[_tokenId];
        address ownerAddress = ownerOf(_tokenId);
        require(msg.value > starCost, "You need to have enough Ether");
        transferFrom(ownerAddress, msg.sender, _tokenId); // We can't use _addTokenTo or_removeTokenFrom functions, now we have to use _transferFrom
        address payable ownerAddressPayable = _make_payable(ownerAddress); // We need to make this conversion to be able to use transfer() function to transfer ethers

        // transfer() method is no longer recommended using: https://consensys.net/diligence/blog/2019/09/stop-using-soliditys-transfer-now/
        // ownerAddressPayable.transfer(starCost); 
        Address.sendValue(ownerAddressPayable, starCost);
        if(msg.value > starCost) {
            Address.sendValue(payable(msg.sender), msg.value - starCost);
            // payable(msg.sender).transfer(msg.value - starCost);
        }
    }

    // Implement Task 1 lookUptokenIdToStarInfo
    function lookUptokenIdToStarInfo (uint _tokenId) public view returns (string memory) {
        //1. You should return the Star saved in tokenIdToStarInfo mapping
        return tokenIdToStarInfo[_tokenId].name;
    }

    // Implement Task 1 Exchange Stars function
    function exchangeStars(uint256 _tokenId1, uint256 _tokenId2) public {
        //1. Passing to star tokenId you will need to check if the owner of _tokenId1 or _tokenId2 is the sender
        if (msg.sender != ownerOf(_tokenId1) && msg.sender != ownerOf(_tokenId2)) {
            revert("You are not the owner of either of the stars");
        } else {
            //2. You don't have to check for the price of the token (star)
            //3. Get the owner of the two tokens (ownerOf(_tokenId1), ownerOf(_tokenId1)
            address owner1 = ownerOf(_tokenId1);
            address owner2 = ownerOf(_tokenId2);
            //4. Use _transferFrom function to exchange the tokens.
            // INFO: _transferForm does not exist anymore in the latest version of openzeppelin, using _transfer instead
            _transfer(owner1, owner2, _tokenId1);
            _transfer(owner2, owner1, _tokenId2);
        } 
    }

    // Implement Task 1 Transfer Stars
    function transferStar(address _to1, uint256 _tokenId) public {
        //1. Check if the sender is the ownerOf(_tokenId)
        //2. Use the transferFrom(from, to, tokenId); function to transfer the Star
        if (msg.sender != ownerOf(_tokenId)) {
            revert("You are not the owner of the star");
        } else {
            transferFrom(msg.sender, _to1, _tokenId);
        }
    }

    // Create function to list all created stars
    function listStarsforDebug() external view returns (Star[] memory) {
        Star[] memory stars = new Star[](50); 

        for (uint256 i = 1; i <= 50; i++) {
            if (_exists(i)) { 
                stars[i - 1] = tokenIdToStarInfo[i];
            }
        }
        return stars;
    }
}
